import { Link } from 'react-router-dom';
import 'react-multi-carousel/lib/styles.css';
import './index.scss';


const Donate = () => {

    return (
        <div className="container donate-page">
            <h1>Donate!</h1>
            <div className='donate-embed'>
                <iframe id="embed"
                    title="donate!"
                    width="300"
                    height="200"
                    src="https://www.paypal.com/donate/?hosted_button_id=2RBFYKYKWFQES">
                </iframe>
             </div>
        </div>

    )
}

export default Donate
